import React from 'react';

const Home = () => {
  return (
    <div className="home">
      <div className="card home-card">
        <h5>ramesh</h5>
        <div className="card-image">
          <img src="https://images.unsplash.com/photo-1498550744921-75f79806b8a7?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60" />
        </div>
        <div className="card-content">
          <h6>title</h6>
          <p>This is an amazing post</p>
          <input type="text" placholder="add a comment" />
        </div>
      </div>
    </div>
  );
};

export default Home;
